'use strict';

var VariableEditPage = require('../../models/pages/VariableEditPage.js');

const gotoVariableEditPage = async ({ request, page, selectors, grafanaVersion }, use, testInfo) => {
  await use(async (args) => {
    const variableEditPage = new VariableEditPage.VariableEditPage({ page, selectors, grafanaVersion, request, testInfo }, args);
    await variableEditPage.goto();
    return variableEditPage;
  });
};

exports.gotoVariableEditPage = gotoVariableEditPage;
